【形状】T10（ W2.1×9.5d ） <br />
【光色】6500k<br />
【光束】45ルーメン<br />
【対応電圧】DC12V（国産車）※輸入車には対応しておりません。<br />
【消費電力】0.5w<br />
【商品内容】LEDバルブ　2球<br />
<br />
【保証期間】発送日より、1年間 <br />
【初期不良対応期間】発送日より、7営業日まで<br />
<br />
【商品について】<br />
・純正球とほぼ同サイズ、信頼性の高い台湾製の高品質LEDバルブです。<br />
・当製品は、純正球の明るさとほぼ同等なのに、消費電力は10分の1と、少ない電力量で明るさを保ちます。<br />
・魅力は、省エネ、長寿命、圧倒的なコストパフォーマンスです。<br />
・用途：ポジション（車幅灯・スモール）・ナンバー灯（番号灯・ライセンス）・ルームランプなど<br />
・極性：極性あり<br />
※取付前の点灯確認をお願い致します。<br />

